import React from 'react'
import ArtworchDark from '../../../../assets/img/logo_dark.svg'
import ArtworchLight from '../../../../assets/img/logo_light.svg'
import {Link} from "react-router-dom";
import IconButton from "@material-ui/core/IconButton";
import { withTheme } from '@material-ui/core/styles';

function Logo(props) {
    const theme = props.theme;

    return (
        <IconButton component={Link} to="/" color='inherit' style={{marginRight: '4px',}}>
                {
                    theme.palette.type === 'dark' ?
                        <img src={ArtworchLight} className={props.size} alt='artworch' /> :
                        <img src={ArtworchDark} className={props.size} alt='artworch' />
                }
        </IconButton>
    )
}

export default withTheme(Logo)
